psinfo=<font color=red>\u916c\u91d1\u7c7b\u578b</font>\uff1a0 \u6807\u51c6\u5361\u56fa\u5b9a\u916c\u91d1\uff0c1 \u6807\u51c6\u5361\u79ef\u5206\u916c\u91d1\uff0c2 \u6807\u51c6\u5361\u4e13\u95e8\u6d25\u8d34\uff0c3 \u6570\u636e\u4e1a\u52a1\u57fa\u672c\u916c\u91d1\uff0c4 \u6570\u636e\u4e1a\u52a1\u5956\u52b1\u916c\u91d1\uff0c<br>5 \u670d\u52a1\u4e1a\u52a1\u57fa\u672c\u916c\u91d1\uff0c6 \u670d\u52a1\u4e1a\u52a1\u5956\u52b1\u916c\u91d1\uff0c7 \u661f\u7ea7\u916c\u91d1\uff0c8 \u9879\u76ee\u542f\u52a8\u91d1 <br><font color=red>\u5907\u6ce8\uff1a</font>\u6bcf\u6b21\u5bfc\u5165\u5fc5\u987b\u586b\u5199\u5907\u6ce8\uff0c\u5730\u5e02\u516c\u53f8\u6309\u5b9e\u9645\u60c5\u51b5\u586b\u5199\uff1b <br><font color=blue>\u672c\u83dc\u5355\u7528\u9014\u4e3b\u8981\u662f\u6ee1\u8db3\u4ee5\u4e0b2\u79cd\u60c5\u51b5\uff1a</font> <br><font color=red>1\u3001</font>\u5bfc\u5165\u7684\u4e1a\u52a1\uff0c\u5bf9\u5e94\u5728\u7cfb\u7edf\u6709\u8bbe\u7f6e\u7701\u516c\u53f8\u7edf\u4e00\u7684\u6821\u9a8c\u6761\u4ef6\uff0c\u4f46\u5730\u5e02\u516c\u53f8\u9700\u8981\u8c03\u6574\uff0c\u8c03\u6574\u53ea\u80fd\u5728\u7cfb\u7edf\u6821\u9a8c\u7684\u7ed3\u679c\u96c6\u8303\u56f4\u5185<br> \u8fd9\u79cd\u60c5\u51b5\u5bfc\u5165\u7684\u4e1a\u52a1\u660e\u7ec6\u6570\u636e\u4f1a\u4e0e\u7cfb\u7edf\u7edf\u4e00\u6821\u9a8c\u7684\u7ed3\u679c\u4f5c\u4ea4\u96c6\uff0c\u4ea4\u96c6\u7684\u6570\u636e\u4e3a\u6700\u7ec8\u6709\u6548\u6570\u636e\uff1b<br>\u4f8b\u5982\uff0c\u5e02\u516c\u53f8\u5bf9"\u4e1a\u52a1\u7f16\u78010101020100002 98\u5143\u65b0\u5546\u65c5\u5957\u9910\u5f00\u6237"\u7684\u916c\u91d1\u7c7b\u578b\u4e3a"5\u670d\u52a1\u4e1a\u52a1\u57fa\u672c\u916c\u91d1"\u7684\u6709\u6548\u6570\u636e\u9700\u8981\u8fdb\u884c<br>\u8c03\u6574\uff0c\u5219\u6309\u754c\u9762\u683c\u5f0f\u5bfc\u5165"\u4e1a\u52a1\u7f16\u78010101020100002 98\u5143\u65b0\u5546\u65c5\u5957\u9910\u5f00\u6237"\u7684\u916c\u91d1\u7c7b\u578b\u4e3a"5\u670d\u52a1\u4e1a\u52a1\u57fa\u672c\u916c\u91d1"<br>\u7684\u6709\u6548\u6570\u636e,\u7cfb\u7edf\u4e2d"\u4e1a\u52a1\u7f16\u78010101020100002 98\u5143\u65b0\u5546\u65c5\u5957\u9910\u5f00\u6237"\u7684\u916c\u91d1\u7c7b\u578b\u4e3a"5\u670d\u52a1\u4e1a\u52a1\u57fa\u672c\u916c\u91d1"\u7684<br>\u6709\u6548\u6570\u636e\u5c06\u4f1a\u4e0e\u5730\u5e02\u5bfc\u5165\u7684"\u4e1a\u52a1\u7f16\u78010101020100002 98\u5143\u65b0\u5546\u65c5\u5957\u9910\u5f00\u6237"\u7684\u916c\u91d1\u7c7b\u578b\u4e3a"5\u670d\u52a1\u4e1a\u52a1\u57fa\u672c\u916c\u91d1"<br>\u7684\u6709\u6548\u6570\u636e\u4f5c\u4ea4\u96c6,\u4ea4\u96c6\u51fa\u7684\u6570\u636e\u4e3a\u6700\u7ec8\u6709\u6548\u8ba1\u916c\u6570\u636e,\u5176\u4ed6\u4e1a\u52a1\u5730\u5e02\u516c\u53f8\u8ba4\u4e3a\u7cfb\u7edf\u662f\u6b63\u786e\u4ee5\u53ca\u53ef\u4ee5\u6ee1\u8db3\u5730\u5e02\u8ba1\u916c\u9700\u6c42,<br>\u5219\u4e0d\u5bfc\u5165\uff0c\u4e0d\u5bfc\u5165\u5219\u4f1a\u4ee5\u7cfb\u7edf\u6709\u6548\u6570\u636e\u8fdb\u884c\u8ba1\u916c\u3002<br> <font color=red>2\u3001</font>\u5bfc\u5165\u7684\u4e1a\u52a1\uff0c\u5982\u679c\u5bf9\u5e94\u5728\u7cfb\u7edf\u65e0\u8bbe\u7f6e\u7701\u516c\u53f8\u7edf\u4e00\u7684\u6821\u9a8c\u6761\u4ef6\uff0c\u7cfb\u7edf\u5219\u4e0d\u652f\u6301\u8fd9\u4e9b\u4e1a\u52a1\u7684\u5730\u5e02\u5bfc\u5165\u5904\u7406; <br><font color=red>\u7279\u522b\u8bf4\u660e\uff1a </font><br>1\u3001\u5e02\u516c\u53f8\u53ef\u4ee5\u4ec5\u5bfc\u5165\u9700\u8c03\u6574\u7684\u76f8\u5173\u4e1a\u52a1\u7f16\u7801\u6709\u6548\u6570\u636e\uff0c\u5bfc\u5165\u540e\u4f1a\u4e0e\u7cfb\u7edf\u5bf9\u5e94<br>\u6d89\u53ca\u7684\u4e1a\u52a1\u7f16\u7801\u6709\u6548\u6570\u636e\uff0c\u4f5c\u4ea4\u96c6\uff0c\u4ea4\u96c6\u51fa\u6765\u4e3a\u6709\u6548\u4e1a\u52a1\u6570\u636e\uff0c<br>\u4ea4\u96c6\u5916\u7684\u7cfb\u7edf\u6709\u6548\u6570\u636e\u4f1a\u81ea\u52a8\u5904\u7406\u4e3a\u65e0\u6548\u6570\u636e\uff1b\u4e0d\u5728\u5bfc\u5165\u8303\u56f4\u7684<br>\u4e1a\u52a1\u7f16\u7801\u6709\u6548\u6570\u636e\u4e0d\u5f71\u54cd\uff0c\u7cfb\u7edf\u4f1a\u81ea\u52a8\u5904\u7406\u4e3a\u6709\u6548\u6570\u636e <br>2\u3001\u9700\u8981\u8c03\u6574\u7684\u4e1a\u52a1\u8bf7\u505a\u6210\u4e00\u4e2a\u